import React, {useEffect, useState} from "react";
import {Nav, NavBarContainer, NavLogo, MobileIcon, NavMenu, NavItem, NavLinks,NavBtn,NavBtnLink,} from "./NavbarElements"
import {FaBars} from 'react-icons/fa';

import {animateScroll as scroll} from 'react-scroll';
const NavBar = ({toggle}) => {

    const toggleHome =() => {
        scroll.scrollTo(10);
    }

    return (
        <>
            <Nav scroll={scroll}>
                <NavBarContainer>
                    <NavLogo to={'/'} onClick={toggleHome}> People Bank </NavLogo>
                    <MobileIcon >
                        <FaBars/>
                    </MobileIcon>
                    <NavMenu>
                        <NavItem >
                            <NavLinks to={'about'} onClick={toggleHome}> About</NavLinks>
                        </NavItem>

                        <NavItem>
                            < NavLinks to={'discover'} onClick={toggleHome}> Discover</NavLinks>
                        </NavItem>

                        <NavItem>
                            <NavLinks to={'services'} onClick={toggleHome}> Services</NavLinks>
                        </NavItem>

                        <NavItem>
                            <NavLinks to={'signUp'} onClick={toggleHome}> Sign Up</NavLinks>
                        </NavItem>
                    </NavMenu>

                    <NavBtn>
                        <NavBtnLink to={'signIn'} >Sign In</NavBtnLink>
                    </NavBtn>
                </NavBarContainer>
            </Nav>

        </>
    );
};
export default NavBar
